    "- Maharashtra's high numbers could be attributed to the measures taken to screen passengers and contact trace people. The state did not start screening travelers until the third week of March, and only from March 22 were all international and domestic flights banned. \n",
    "\n",
    "\n",
    "- On 17 January, only passengers from China and Hong Kong were being screened at three Indian airports â€” Mumbai, New Delhi and Kolkata. Four days later, this was expanded to include four other airports â€” Chennai, Hyderabad, Kochi and Bengaluru, but passengers from other countries were not included. By February 26, passengers from Italy were being screened, but other European countries were exempted. Universal screening began only on March 17. Other European countries (such as Germany, UK, France, etc.) began reporting cases a couple of days after India began screening Italy. Considering COVID-19's long incubation period of 14-21 days, it is entirely possible that people entering India were already infected and not screened.\n",
    "\n",
    "\n",
    "- Mumbai airport saw nearly 12.36 million international passengers during 2018-2019. Assuming similar numbers for the year 2019-2020, if screening was not implemented early enough, it is no surprise that Maharashtra is seeing a huge number of cases. \n",
    "\n",
    "\n",
    "- The state government prohibited people from stepping out without masks on April 9. However, a month earlier, on March 4, Maharashtra also said that the general public need not use face masks. It is very likely that people did not use face masks during this time period, and the people who got infected during this time period would probably be detected 2-3 weeks later, approximately between April 23 and May 1.\n",
    "\n",
    "- COVID-19 has a calculated R0 factor of 6.6, so any infected person is likely to spread it to 6-7 other people. According to UC San Francisco, if even 80% of the population wears masks, they will do more to prevent the spread than a strict lockdown ever could.\n",
    "\n",
