    "Of all the metropoalitan cities in India, Mumbai has the highest population density by far, which could have contributed to the easy spread of cases. The presence of Dharavi (the largest slum in Asia) may have also contributed to the meteoric rise in cases. Dharavi had 491 cases in April 2020 with a 12% growth rate and a case doubling period of 18 days.\n",
    "\n",
    "Dharavi has poor sewage facilities and improper drainage systems. The place has severe sanitation issues and around 80% of the population depend on community toilets. There is only an average of 1 toilet per 500 people in the area. All these factors, and more, could have made Mumbai vulnerable to COVID-19.\n",
    "\n",
    "However, the spread was maintained within Dharavi. Nearly 90% of patients were treated within Dharavi itself, and only critical ones were moved to hospitals. The state's response strategy ensured that all infected people were properly contained, and there was uninterrupted supply of goods and essential supplies to the area.\n",
    "\n",
    "Although Dharavi contributed to the majority of cases in Mumbai, they were contained within the area. \n",
